def transform(sequence):
    first_non_zero = next((i for i, num in enumerate(sequence) if num != 0), len(sequence))
    if first_non_zero % 8 == 0:
        return sequence
    else:
        rotation_idx = (8 - first_non_zero % 8) % 8
        return sequence[rotation_idx:] + sequence[:rotation_idx]
